import FocusedProfileContent from "./focusedProfileContent"
import SimpleBarReact from 'simplebar-react';

//Extends Focused
export default function FocusedProfile({focusedItem}) {
  return (
    <div style={{width: "97%", margin: "12px auto 0px auto", border: "2px solid #044b5f", height: "71%"}}>
      <div style={focusedDataTitle}>Profile</div>
      <SimpleBarReact style={{height: "96.4%"}}>
        <div style={{width: "100%", height: "96.4%"}}>
          <div 
            style={{
              backgroundColor: "#e4f7ff",
              fontSize: "11px",
              paddingBottom: "3px"
            }}>
            <FocusedProfileContent itemObject={focusedItem.data}/>
          </div>
        </div>
      </SimpleBarReact>
    </div>
  )
}
